"use strict";(self.webpackChunkslack_avatar=self.webpackChunkslack_avatar||[]).push([[796],{1971:a=>{a.exports=JSON.parse('{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/slack-avatar/blog/welcome","source":"@site/blog/2023-12-09-welcome.md","title":"\uc218\ud559\ub300\uc655\uc758 \ud654\ub824\ud55c \uc544\ubc14\ud0c0\ub4e4, Sicei\uc758 \uc791\ud488 \uc138\uacc4\ub85c\uc758 \ucd08\ub300","description":"Sicei\uc758 \ucc3d\uc758\uc131\uc774 \ube5b\ub098\ub294 \uc544\ubc14\ud0c0\ub4e4\uacfc \ub9cc\ub098\ub2e4","date":"2023-12-09T00:00:00.000Z","formattedDate":"2023\ub144 12\uc6d4 9\uc77c","tags":[{"label":"fun","permalink":"/slack-avatar/blog/tags/fun"},{"label":"cool","permalink":"/slack-avatar/blog/tags/cool"},{"label":"sexy","permalink":"/slack-avatar/blog/tags/sexy"}],"readingTime":2.695,"hasTruncateMarker":false,"authors":[{"name":"Mystic","title":"Maintainer of MJStudio","url":"https://github.com/mym0404","imageURL":"https://i.pinimg.com/736x/e7/81/91/e78191a52c9b68f00dd8ae80cacce66a.jpg","key":"mj"}],"frontMatter":{"slug":"welcome","title":"\uc218\ud559\ub300\uc655\uc758 \ud654\ub824\ud55c \uc544\ubc14\ud0c0\ub4e4, Sicei\uc758 \uc791\ud488 \uc138\uacc4\ub85c\uc758 \ucd08\ub300","authors":"mj","tags":["fun","cool","sexy"]},"unlisted":false,"nextItem":{"title":"\uc218\ud559\ub300\uc655\uc758 \uc544\ubc14\ud0c0 \ud0d0\uad6c: Hue\uc758 \ucc3d\uc758\uc801 \ubc1c\uc0c1","permalink":"/slack-avatar/blog/hue"}},"content":"## Sicei\uc758 \ucc3d\uc758\uc131\uc774 \ube5b\ub098\ub294 \uc544\ubc14\ud0c0\ub4e4\uacfc \ub9cc\ub098\ub2e4\\n\\n\\"\uc218\ud559\ub300\uc655\\" \uc11c\ube44\uc2a4\ub294 \ub2e8\uc21c\ud788 \uc218\ud559 \ubb38\uc81c\ub97c \ud480\uc5b4\ub098\uac00\ub294 \ud50c\ub7ab\ud3fc\uc774 \uc544\ub2d9\ub2c8\ub2e4. \uc5ec\uae30\uc5d0\ub294 \uc0ac\uc6a9\uc790\ub4e4\uc758 \ud559\uc2b5 \uacbd\ud5d8\uc744 \ud48d\ubd80\ud558\uac8c \ub9cc\ub4e4\uc5b4\uc8fc\ub294 \ub3c5\ud2b9\ud558\uace0 \ub9e4\ub825\uc801\uc778 \uc544\ubc14\ud0c0\ub4e4\uc774 \uc874\uc7ac\ud569\ub2c8\ub2e4. \uc774 \uc544\ubc14\ud0c0\ub4e4\uc740 \ubc14\ub85c \uc720\uba85\ud55c \ub514\uc790\uc774\ub108 Sicei\uac00 \ucc3d\uc870\ud55c \uc791\ud488\ub4e4\uc774\uc8e0.\\n\\n## \uc544\ubc14\ud0c0\ub4e4\uc758 \ub2e4\ucc44\ub85c\uc6b4 \uc138\uacc4\\n\\n\uac01 \uc544\ubc14\ud0c0\ub294 \uace0\uc720\ud55c \uac1c\uc131\uacfc \uc2a4\ud0c0\uc77c\uc744 \uac00\uc9c0\uace0 \uc788\uc73c\uba70, \ub2e4\uc591\ud55c \uc218\ud559\uc801 \uac1c\ub150\uc744 \uc0c1\uc9d5\ud654\ud569\ub2c8\ub2e4. \uc608\ub97c \ub4e4\uc5b4, \ubd84\uc218\ub97c \ud14c\ub9c8\ub85c \ud55c \uc544\ubc14\ud0c0\ub294 \uc870\uac01\uc870\uac01 \ub098\ub25c \ubaa8\uc790\uc640 \uc758\uc0c1\uc744 \uc785\uace0 \uc788\uc73c\uba70, \uae30\ud558\ud559 \uc544\ubc14\ud0c0\ub294 \ub2e4\uba74\uccb4 \ud615\ud0dc\uc758 \uc561\uc138\uc11c\ub9ac\ub85c \uc7a5\uc2dd\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## Sicei\uc758 \ub514\uc790\uc778 \ucca0\ud559\\n\\nSicei\uc758 \ub514\uc790\uc778\uc740 \ub2e8\uc21c\ud788 \ubbf8\uc801\uc778 \uc694\uc18c\uc5d0\ub9cc \uadf8\uce58\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uac01 \uc544\ubc14\ud0c0\ub294 \uc218\ud559\uc801 \uc6d0\ub9ac\uc640 \uac1c\ub150\uc744 \uc2dc\uac01\uc801\uc73c\ub85c \ud45c\ud604\ud558\uba70, \uc774\ub97c \ud1b5\ud574 \uc0ac\uc6a9\uc790\ub4e4\uc774 \uc218\ud559\uc5d0 \ub300\ud55c \ub354 \uae4a\uc740 \uc774\ud574\uc640 \ud765\ubbf8\ub97c \ub290\ub084 \uc218 \uc788\ub3c4\ub85d \ub3d5\uc2b5\ub2c8\ub2e4. Sicei\ub294 \\"\uc544\ubc14\ud0c0\ub97c \ud1b5\ud574 \uc218\ud559\uc758 \uc544\ub984\ub2e4\uc6c0\uc744 \uc804\ub2ec\ud558\uace0\uc790 \ud55c\ub2e4\\"\uace0 \ub9d0\ud588\uc2b5\ub2c8\ub2e4.\\n\\n## \uc0ac\uc6a9\uc790\ub4e4\uc758 \ubc18\uc751\\n\\n\\"\uc218\ud559\ub300\uc655\\"\uc758 \uc0ac\uc6a9\uc790\ub4e4 \uc0ac\uc774\uc5d0\uc11c \uc774 \uc544\ubc14\ud0c0\ub4e4\uc740 \ud070 \uc778\uae30\ub97c \uc5bb\uace0 \uc788\uc2b5\ub2c8\ub2e4. \ub9ce\uc740 \ud559\uc0dd\ub4e4\uc774 \uc790\uc2e0\ub9cc\uc758 \uc544\ubc14\ud0c0\ub97c \uc120\ud0dd\ud558\uace0, \uadf8 \uc544\ubc14\ud0c0\ub97c \ud1b5\ud574 \uc218\ud559 \ubb38\uc81c\ub97c \ud574\uacb0\ud558\uba70 \ub3c5\ud2b9\ud55c \ud559\uc2b5 \uacbd\ud5d8\uc744 \uc990\uae30\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## \ub9fa\uc74c\ub9d0\\n\\nSicei\uc758 \uc190\uae38\uc774 \ub2ff\uc740 \\"\uc218\ud559\ub300\uc655\\"\uc758 \uc544\ubc14\ud0c0\ub4e4\uc740 \ub2e8\uc21c\ud55c \uce90\ub9ad\ud130\ub97c \ub118\uc5b4\uc11c \ud559\uc2b5 \ub3c4\uad6c\uc774\uc790 \uc608\uc220 \uc791\ud488\uc785\ub2c8\ub2e4. \uc774 \uc544\ubc14\ud0c0\ub4e4\uc744 \ud1b5\ud574 \uc218\ud559\uc740 \ub354 \uc774\uc0c1 \ub531\ub531\ud558\uace0 \uc9c0\ub8e8\ud55c \uacfc\ubaa9\uc774 \uc544\ub2c8\ub77c, \uc990\uac81\uace0 \ub9e4\ub825\uc801\uc778 \uc138\uacc4\ub85c \ubcc0\ubaa8\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \\"\uc218\ud559\ub300\uc655\\"\uacfc \ud568\uaed8\ub77c\uba74 \uc218\ud559\uc758 \uc138\uacc4\uac00 \ud6e8\uc52c \ub354 \ud765\ubbf8\ub86d\uace0 \uc990\uac70\uc6b4 \uc5ec\uc815\uc774 \ub420 \uac83\uc785\ub2c8\ub2e4."},{"id":"hue","metadata":{"permalink":"/slack-avatar/blog/hue","source":"@site/blog/2023-12-08-hue.md","title":"\uc218\ud559\ub300\uc655\uc758 \uc544\ubc14\ud0c0 \ud0d0\uad6c: Hue\uc758 \ucc3d\uc758\uc801 \ubc1c\uc0c1","description":"Hue\uc758 \uc720\ub2c8\ud06c\ud55c \uc544\ubc14\ud0c0 \ub514\uc790\uc778","date":"2023-12-08T00:00:00.000Z","formattedDate":"2023\ub144 12\uc6d4 8\uc77c","tags":[{"label":"fun","permalink":"/slack-avatar/blog/tags/fun"},{"label":"cool","permalink":"/slack-avatar/blog/tags/cool"},{"label":"sexy","permalink":"/slack-avatar/blog/tags/sexy"}],"readingTime":1.69,"hasTruncateMarker":false,"authors":[{"name":"Mystic","title":"Maintainer of MJStudio","url":"https://github.com/mym0404","imageURL":"https://i.pinimg.com/736x/e7/81/91/e78191a52c9b68f00dd8ae80cacce66a.jpg","key":"mj"}],"frontMatter":{"slug":"hue","title":"\uc218\ud559\ub300\uc655\uc758 \uc544\ubc14\ud0c0 \ud0d0\uad6c: Hue\uc758 \ucc3d\uc758\uc801 \ubc1c\uc0c1","authors":"mj","tags":["fun","cool","sexy"]},"unlisted":false,"prevItem":{"title":"\uc218\ud559\ub300\uc655\uc758 \ud654\ub824\ud55c \uc544\ubc14\ud0c0\ub4e4, Sicei\uc758 \uc791\ud488 \uc138\uacc4\ub85c\uc758 \ucd08\ub300","permalink":"/slack-avatar/blog/welcome"},"nextItem":{"title":"\uc218\ud559\ub300\uc655\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc758 \ub9c8\ubc95\uc0ac: Lucy\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \ub9c8\ubc95","permalink":"/slack-avatar/blog/lucy"}},"content":"## Hue\uc758 \uc720\ub2c8\ud06c\ud55c \uc544\ubc14\ud0c0 \ub514\uc790\uc778\\n\\n\\"\uc218\ud559\ub300\uc655\\"\uc5d0\uc11c Hue\uc758 \uc544\ubc14\ud0c0\ub4e4\uc740 \uadf8\ub140\uc758 \ub3c5\ud2b9\ud55c \ucc3d\uc758\ub825\uacfc \ud601\uc2e0\uc801\uc778 \ub514\uc790\uc778 \ucca0\ud559\uc744 \ubc18\uc601\ud569\ub2c8\ub2e4. Hue\ub294 \uc804\ud1b5\uc801\uc778 \uc218\ud559\uc801 \uc0c1\uc9d5\ub4e4\uc744 \ud604\ub300\uc801\uc774\uace0 \uc0c9\ub2e4\ub978 \ubc29\uc2dd\uc73c\ub85c \uc7ac\ud574\uc11d\ud574 \uc0ac\uc6a9\uc790\ub4e4\uc5d0\uac8c \uc0c8\ub85c\uc6b4 \uc2dc\uac01\uc801 \uacbd\ud5d8\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4.\\n\\n## \uc544\ubc14\ud0c0\ub4e4\uc758 \ub2e4\uc591\ud55c \ud45c\ud604\\n\\nHue\uc758 \uc791\ud488\ub4e4\uc740 \ubcf5\uc7a1\ud55c \uc218\ud559\uc801 \uc544\uc774\ub514\uc5b4\ub97c \ub2e8\uc21c\ud558\uace0 \uc774\ud574\ud558\uae30 \uc26c\uc6b4 \uc2dc\uac01\uc801 \uc5b8\uc5b4\ub85c \uc804\ud658\ud569\ub2c8\ub2e4. \uadf8\ub140\uc758 \uc544\ubc14\ud0c0\ub4e4\uc740 \uac15\ub82c\ud55c \uc0c9\uc0c1\uacfc \ub3c5\ud2b9\ud55c \ud615\ud0dc\ub85c \uc218\ud559\uc758 \ub2e4\ucc44\ub85c\uc6b4 \uba74\ubaa8\ub97c \ubcf4\uc5ec\uc90d\ub2c8\ub2e4.\\n\\n## \uc0ac\uc6a9\uc790\ub4e4\uacfc\uc758 \uc18c\ud1b5\\n\\nHue\ub294 \uc0ac\uc6a9\uc790\uc758 \ud53c\ub4dc\ubc31\uc744 \uc801\uadf9\uc801\uc73c\ub85c \ubc18\uc601\ud558\uc5ec \uc544\ubc14\ud0c0\ub4e4\uc744 \uc9c0\uc18d\uc801\uc73c\ub85c \ubc1c\uc804\uc2dc\ud0b5\ub2c8\ub2e4. \uadf8\ub140\uc758 \uc811\uadfc \ubc29\uc2dd\uc740 \uc0ac\uc6a9\uc790\ub4e4\ub85c \ud558\uc5ec\uae08 \uc790\uc2e0\ub4e4\uc758 \uc218\ud559 \ud559\uc2b5 \uacbd\ud5d8\uc744 \ubcf4\ub2e4 \uac1c\uc778\uc801\uc774\uace0 \uc758\ubbf8 \uc788\uac8c \ub9cc\ub4e4\ub3c4\ub85d \ub3d5\uc2b5\ub2c8\ub2e4.\\n\\n## \ub9fa\uc74c\ub9d0\\n\\nHue\uc758 \uc544\ubc14\ud0c0\ub4e4\uc740 \\"\uc218\ud559\ub300\uc655\\" \uc11c\ube44\uc2a4\uc5d0\uc11c \ube7c\ub193\uc744 \uc218 \uc5c6\ub294 \uc911\uc694\ud55c \uc694\uc18c\uc785\ub2c8\ub2e4. \uadf8\ub140\uc758 \ucc3d\uc758\uc801\uc774\uace0 \uc2e0\uc120\ud55c \uc811\uadfc\uc740 \uc218\ud559\uc744 \ub354\uc6b1 \ud765\ubbf8\ub86d\uace0 \uce5c\uadfc\ud558\uac8c \ub9cc\ub4e4\uc5b4\uc90d\ub2c8\ub2e4."},{"id":"lucy","metadata":{"permalink":"/slack-avatar/blog/lucy","source":"@site/blog/2023-12-08-lucy.md","title":"\uc218\ud559\ub300\uc655\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc758 \ub9c8\ubc95\uc0ac: Lucy\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \ub9c8\ubc95","description":"Lucy, \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc758 \ud601\uc2e0\uac00","date":"2023-12-08T00:00:00.000Z","formattedDate":"2023\ub144 12\uc6d4 8\uc77c","tags":[{"label":"fun","permalink":"/slack-avatar/blog/tags/fun"},{"label":"cool","permalink":"/slack-avatar/blog/tags/cool"},{"label":"sexy","permalink":"/slack-avatar/blog/tags/sexy"}],"readingTime":1.71,"hasTruncateMarker":false,"authors":[{"name":"Mystic","title":"Maintainer of MJStudio","url":"https://github.com/mym0404","imageURL":"https://i.pinimg.com/736x/e7/81/91/e78191a52c9b68f00dd8ae80cacce66a.jpg","key":"mj"}],"frontMatter":{"slug":"lucy","title":"\uc218\ud559\ub300\uc655\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc758 \ub9c8\ubc95\uc0ac: Lucy\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \ub9c8\ubc95","authors":"mj","tags":["fun","cool","sexy"]},"unlisted":false,"prevItem":{"title":"\uc218\ud559\ub300\uc655\uc758 \uc544\ubc14\ud0c0 \ud0d0\uad6c: Hue\uc758 \ucc3d\uc758\uc801 \ubc1c\uc0c1","permalink":"/slack-avatar/blog/hue"},"nextItem":{"title":"\uc218\ud559\ub300\uc655\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc758 \uc228\uc740 \uc601\uc6c5: Lullu\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c","permalink":"/slack-avatar/blog/lullu"}},"content":"## Lucy, \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc758 \ud601\uc2e0\uac00\\n\\nLucy\ub294 \\"\uc218\ud559\ub300\uc655\\" \uc11c\ube44\uc2a4\uc5d0\uc11c \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc790\ub85c\uc11c \uc911\ucd94\uc801\uc778 \uc5ed\ud560\uc744 \ud569\ub2c8\ub2e4. \uadf8\ub140\uc758 \uc804\ubb38\uc131\uc740 \uc0ac\uc6a9\uc790 \uc778\ud130\ud398\uc774\uc2a4(UI)\uc640 \uc0ac\uc6a9\uc790 \uacbd\ud5d8(UX)\uc758 \ud601\uc2e0\uc744 \ud1b5\ud574 \uba85\ud655\ud558\uac8c \ub4dc\ub7ec\ub0a9\ub2c8\ub2e4.\\n\\n## \uc0ac\uc6a9\uc790 \uacbd\ud5d8\uc758 \ucd5c\uc801\ud654\\n\\nLucy\uc758 \uc791\uc5c5\uc740 \uc0ac\uc6a9\uc790\ub4e4\uc774 \uc11c\ube44\uc2a4\ub97c \ub354 \uc27d\uace0 \uc9c1\uad00\uc801\uc73c\ub85c \uc774\uc6a9\ud560 \uc218 \uc788\ub3c4\ub85d \ub9cc\ub4e4\uc5b4\uc90d\ub2c8\ub2e4. \uadf8\ub140\ub294 \ubcf5\uc7a1\ud55c \uc218\ud559\uc801 \uac1c\ub150\ub4e4\uc744 \uac04\uacb0\ud558\uace0 \uc774\ud574\ud558\uae30 \uc26c\uc6b4 \ud615\ud0dc\ub85c \ud45c\ud604\ud558\ub294\ub370 \uc911\uc810\uc744 \ub450\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## \uae30\uc220\uc801 \uc804\ubb38\uc131\uacfc \ucc3d\uc758\uc131\uc758 \uacb0\ud569\\n\\nLucy\ub294 \ucd5c\uc2e0 \uc6f9 \uae30\uc220\uacfc \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4\ub97c \ud65c\uc6a9\ud558\uc5ec \\"\uc218\ud559\ub300\uc655\\"\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc\ub97c \uad6c\ucd95\ud569\ub2c8\ub2e4. \uadf8\ub140\uc758 \uae30\uc220\uc801 \ub2a5\ub825\uc740 \uc11c\ube44\uc2a4\uac00 \uc6d0\ud65c\ud558\uace0 \ube60\ub974\uac8c \uc791\ub3d9\ud558\ub3c4\ub85d \ubcf4\uc7a5\ud558\uba70, \ub3d9\uc2dc\uc5d0 \ucc3d\uc758\uc801\uc778 \uc694\uc18c\ub4e4\uc744 \ud1b5\ud569\ud569\ub2c8\ub2e4.\\n\\n## \ub9fa\uc74c\ub9d0\\n\\nLucy\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c \ub2a5\ub825\uc740 \\"\uc218\ud559\ub300\uc655\\" \uc11c\ube44\uc2a4\ub97c \ub354\uc6b1 \ub9e4\ub825\uc801\uc774\uace0 \uc0ac\uc6a9\uc790 \uce5c\ud654\uc801\uc778 \ud50c\ub7ab\ud3fc\uc73c\ub85c \ub9cc\ub4e4\uc5b4\uc90d\ub2c8\ub2e4. \uadf8\ub140\uc758 \uc791\uc5c5\uc740 \uc0ac\uc6a9\uc790\ub4e4\uc774 \uc218\ud559\uc744 \ubcf4\ub2e4 \uc27d\uace0 \uc990\uac81\uac8c \ubc30\uc6b8 \uc218 \uc788\ub294 \ud658\uacbd\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4."},{"id":"lullu","metadata":{"permalink":"/slack-avatar/blog/lullu","source":"@site/blog/2023-12-08-lullu.md","title":"\uc218\ud559\ub300\uc655\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc758 \uc228\uc740 \uc601\uc6c5: Lullu\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c","description":"Lullu, \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc758 \ud575\uc2ec","date":"2023-12-08T00:00:00.000Z","formattedDate":"2023\ub144 12\uc6d4 8\uc77c","tags":[{"label":"fun","permalink":"/slack-avatar/blog/tags/fun"},{"label":"cool","permalink":"/slack-avatar/blog/tags/cool"},{"label":"sexy","permalink":"/slack-avatar/blog/tags/sexy"}],"readingTime":1.565,"hasTruncateMarker":false,"authors":[{"name":"Mystic","title":"Maintainer of MJStudio","url":"https://github.com/mym0404","imageURL":"https://i.pinimg.com/736x/e7/81/91/e78191a52c9b68f00dd8ae80cacce66a.jpg","key":"mj"}],"frontMatter":{"slug":"lullu","title":"\uc218\ud559\ub300\uc655\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc758 \uc228\uc740 \uc601\uc6c5: Lullu\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c","authors":"mj","tags":["fun","cool","sexy"]},"unlisted":false,"prevItem":{"title":"\uc218\ud559\ub300\uc655\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc758 \ub9c8\ubc95\uc0ac: Lucy\uc758 \ud504\ub860\ud2b8\uc5d4\ub4dc \ub9c8\ubc95","permalink":"/slack-avatar/blog/lucy"},"nextItem":{"title":"\uc218\ud559\ub300\uc655\uc758 \ube5b\ub098\ub294 \ubcc4: Zoe\uc758 \uc544\ud2b8\uc6cc\ud06c","permalink":"/slack-avatar/blog/zoe"}},"content":"## Lullu, \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc758 \ud575\uc2ec\\n\\nLullu\ub294 \\"\uc218\ud559\ub300\uc655\\" \uc11c\ube44\uc2a4\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc790\ub85c\uc11c \uc11c\ube44\uc2a4\uc758 \uc548\uc815\uc801\uc774\uace0 \ud6a8\uc728\uc801\uc778 \uc6b4\uc601\uc744 \ucc45\uc784\uc9d1\ub2c8\ub2e4. \uadf8\ub140\uc758 \uae30\uc220\uc801 \uc9c0\uc2dd\uacfc \uacbd\ud5d8\uc740 \uc11c\ube44\uc2a4\uc758 \ubb34\ub300 \ub4a4\uc5d0\uc11c \uc911\uc694\ud55c \uc5ed\ud560\uc744 \ud569\ub2c8\ub2e4.\\n\\n## \uc11c\ube44\uc2a4\uc758 \uc2ec\uc7a5, \ubc31\uc5d4\ub4dc\\n\\nLullu\uc758 \uc791\uc5c5\uc740 \uc0ac\uc6a9\uc790\ub4e4\uc774 \uc9c1\uc811\uc801\uc73c\ub85c \ubcf4\uac70\ub098 \ub290\ub07c\uc9c0 \ubabb\ud558\ub294 \uc11c\ube44\uc2a4\uc758 \ud575\uc2ec\uc744 \uc774\ub8f9\ub2c8\ub2e4. \uadf8\ub140\ub294 \ub370\uc774\ud130 \uad00\ub9ac, \uc11c\ubc84 \ud1b5\uc2e0, \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc758 \uc131\ub2a5 \ucd5c\uc801\ud654 \ub4f1\uc744 \ub2f4\ub2f9\ud558\uba70 \\"\uc218\ud559\ub300\uc655\\"\uc758 \uc548\uc815\uc801\uc778 \uae30\ub2a5\uc744 \ubcf4\uc7a5\ud569\ub2c8\ub2e4.\\n\\n## \ubcf5\uc7a1\ud55c \ubb38\uc81c\uc758 \ud574\uacb0\uc0ac\\n\\n\ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc790\ub85c\uc11c Lullu\ub294 \ubcf5\uc7a1\ud55c \uae30\uc220\uc801 \ubb38\uc81c\ub97c \ud574\uacb0\ud558\ub294\ub370 \ub2a5\uc219\ud569\ub2c8\ub2e4. \uadf8\ub140\ub294 \uc11c\ube44\uc2a4\uac00 \uc6d0\ud65c\ud558\uac8c \uc791\ub3d9\ud558\ub3c4\ub85d \uc9c0\uc18d\uc801\uc73c\ub85c \uc2dc\uc2a4\ud15c\uc744 \ubaa8\ub2c8\ud130\ub9c1\ud558\uace0 \uac1c\uc120\ud569\ub2c8\ub2e4.\\n\\n## \ub9fa\uc74c\ub9d0\\n\\nLullu\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c \ub2a5\ub825\uc740 \\"\uc218\ud559\ub300\uc655\\" \uc11c\ube44\uc2a4\uc758 \ub4e0\ub4e0\ud55c \uae30\ubc18\uc744 \uc774\ub8f9\ub2c8\ub2e4. \uadf8\ub140\uc758 \ub178\ub825\uacfc \uc804\ubb38\uc131\uc740 \uc11c\ube44\uc2a4\uac00 \uc548\uc815\uc801\uc73c\ub85c \uc6b4\uc601\ub420 \uc218 \uc788\ub3c4\ub85d \ud558\ub294 \ub370 \ud544\uc218\uc801\uc778 \uc694\uc18c\uc785\ub2c8\ub2e4."},{"id":"zoe","metadata":{"permalink":"/slack-avatar/blog/zoe","source":"@site/blog/2023-12-08-zoe.md","title":"\uc218\ud559\ub300\uc655\uc758 \ube5b\ub098\ub294 \ubcc4: Zoe\uc758 \uc544\ud2b8\uc6cc\ud06c","description":"Zoe\uc758 \uc608\uc220\uc801 \uc544\ubc14\ud0c0 \ub514\uc790\uc778","date":"2023-12-08T00:00:00.000Z","formattedDate":"2023\ub144 12\uc6d4 8\uc77c","tags":[{"label":"fun","permalink":"/slack-avatar/blog/tags/fun"},{"label":"cool","permalink":"/slack-avatar/blog/tags/cool"},{"label":"sexy","permalink":"/slack-avatar/blog/tags/sexy"}],"readingTime":1.625,"hasTruncateMarker":false,"authors":[{"name":"Mystic","title":"Maintainer of MJStudio","url":"https://github.com/mym0404","imageURL":"https://i.pinimg.com/736x/e7/81/91/e78191a52c9b68f00dd8ae80cacce66a.jpg","key":"mj"}],"frontMatter":{"slug":"zoe","title":"\uc218\ud559\ub300\uc655\uc758 \ube5b\ub098\ub294 \ubcc4: Zoe\uc758 \uc544\ud2b8\uc6cc\ud06c","authors":"mj","tags":["fun","cool","sexy"]},"unlisted":false,"prevItem":{"title":"\uc218\ud559\ub300\uc655\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc758 \uc228\uc740 \uc601\uc6c5: Lullu\uc758 \ubc31\uc5d4\ub4dc \uac1c\ubc1c","permalink":"/slack-avatar/blog/lullu"}},"content":"## Zoe\uc758 \uc608\uc220\uc801 \uc544\ubc14\ud0c0 \ub514\uc790\uc778\\n\\nZoe\ub294 \\"\uc218\ud559\ub300\uc655\\"\uc758 \uc544\ubc14\ud0c0\ub4e4\uc744 \ud1b5\ud574 \uc608\uc220\uc801 \uac10\uac01\uacfc \uc218\ud559\uc801 \uc9c0\uc2dd\uc744 \uc811\ubaa9\uc2dc\ud0b5\ub2c8\ub2e4. \uadf8\ub140\uc758 \uc544\ubc14\ud0c0\ub4e4\uc740 \uc608\uc220 \uc791\ud488\ucc98\ub7fc \uc12c\uc138\ud558\uace0 \uc544\ub984\ub2f5\uac8c \uad6c\uc131\ub418\uc5b4 \uc788\uc73c\uba70, \uc0ac\uc6a9\uc790\ub4e4\uc5d0\uac8c \uc601\uac10\uc744 \uc8fc\ub294 \ub3c5\ucc3d\uc801\uc778 \uc2a4\ud0c0\uc77c\uc744 \uc9c0\ub2c8\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## \uc544\ubc14\ud0c0\uc640 \uc608\uc220\uc758 \uc870\ud654\\n\\nZoe\uc758 \uc544\ubc14\ud0c0\ub4e4\uc740 \uace0\uc804 \ubbf8\uc220\uc5d0\uc11c \uc601\uac10\uc744 \ubc1b\uc740 \ub514\uc790\uc778 \uc694\uc18c\ub4e4\uc744 \ud3ec\ud568\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574 \uc218\ud559 \uac1c\ub150\uc744 \ub354 \uae4a\uc774 \uc788\uace0 \uc608\uc220\uc801\uc73c\ub85c \ud45c\ud604\ud558\uba70, \uc0ac\uc6a9\uc790\ub4e4\uc5d0\uac8c \uc218\ud559\uacfc \uc608\uc220\uc758 \uc811\uc810\uc744 \uacbd\ud5d8\ud558\uac8c \ud569\ub2c8\ub2e4.\\n\\n## \uc0ac\uc6a9\uc790 \uacbd\ud5d8\uc758 \ud5a5\uc0c1\\n\\nZoe\uc758 \uc544\ubc14\ud0c0\ub4e4\uc740 \uc0ac\uc6a9\uc790\ub4e4\uc774 \uc218\ud559\uc744 \ub354 \uc798 \uc774\ud574\ud558\uace0 \uc990\uae38 \uc218 \uc788\ub3c4\ub85d \ub3d5\uc2b5\ub2c8\ub2e4. \uadf8\ub140\uc758 \uc791\ud488\uc740 \ud559\uc2b5\uc744 \ub354\uc6b1 \ud48d\ubd80\ud558\uace0 \ub2e4\uce35\uc801\uc778 \uacbd\ud5d8\uc73c\ub85c \ub9cc\ub4e4\uc5b4\uc90d\ub2c8\ub2e4.\\n\\n## \ub9fa\uc74c\ub9d0\\n\\nZoe\uc758 \uc544\ubc14\ud0c0\ub4e4\uc740 \\"\uc218\ud559\ub300\uc655\\" \uc11c\ube44\uc2a4\uc5d0\uc11c \ud2b9\ubcc4\ud55c \uc874\uc7ac\uac10\uc744 \ubc1c\ud718\ud569\ub2c8\ub2e4. \uadf8\ub140\uc758 \uc544\ud2b8\uc6cc\ud06c\ub294 \uc218\ud559 \ud559\uc2b5\uc744 \uc608\uc220\uc801\uc778 \uc5ec\uc815\uc73c\ub85c \ubcc0\ubaa8\uc2dc\ud0a4\uba70 \uc0ac\uc6a9\uc790\ub4e4\uc5d0\uac8c \ud070 \uc778\uc0c1\uc744 \ub0a8\uae41\ub2c8\ub2e4."}]}')}}]);